import styles from './AccentImage.module.css'
import React from 'react';

export default function AccentImage(props) {
    return (
            <div className={`${styles.med_img} ${styles.ks_accent_img}`}>
                <img src={props.image_path} className={`${styles.med_img} ${styles.circle}`} alt={'Image showing a likeness of Kytra.'}/>
            </div>
    )
}
